import React from 'react'

function Input({ name, ref }) {
  return (
    <div className="form-group">
      <label htmlFor={name}>UserName</label>
      <input
        type="text"
        autoFocus
        ref={ref}
        id={name}
        className="form-control"
      ></input>
    </div>
  )
}

export default Input
